import logo from './logo.svg';

function ServicePage() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          This is Service Page
        </p>

      </header>
    </div>
  );
}

export default ServicePage;
